import { Swiper, SwiperSlide } from "swiper/react";

// Import Swiper styles
import "swiper/css";
import "swiper/css/pagination"



const AmazingProduct = () => {

  const [products, setProducts] = [
    { photo: '', name: '', price: 257.000, discount: 40 }
  ]

  return (
    <div className='w-full bg-violet-500'>
      <div className='container mx-auto'>
        <div className='w-2/6 lg:w-1/6 md:w-1/6'></div>
        <div className='w-4/6 lg:w-5/6 md:w-5/6 p-2 md:p-4 ' dir='rtl'>
          <Swiper slidesPerView={1} spaceBetween={5}
            pagination={{ "clickable": true }}
            breakpoints={{
              "@0.00": {
                "slidesPerView": 1,
                "spaceBetween": 10
              }, "@0.50": {
                "slidesPerView": 1.2,
                "spaceBetween": 10
              },
              "@0.75": {
                "slidesPerView": 1.3,
                "spaceBetween": 10
              },
              "@0.90": {
                "slidesPerView": 1.5,
                "spaceBetween": 10
              },
              "@1.00": {
                "slidesPerView": 1.7,
                "spaceBetween": 10
              }, "@1.15": {
                "slidesPerView": 2.5,
                "spaceBetween": 10
              },
              "@1.50": {
                "slidesPerView": 3.3,
                "spaceBetween": 10
              },
              "@1.80": {
                "slidesPerView": 4,
                "spaceBetween": 10
              },
              "@2.00": {
                "slidesPerView": 3.5,
                "spaceBetween": 10
              }
            }} className="mySwiper">
            <SwiperSlide className='rounded-md w-auto p-2'><div className='w-32 h-80'></div></SwiperSlide>
            <SwiperSlide className='rounded-md w-auto p-2'><div className='w-32 h-80'></div></SwiperSlide>
            <SwiperSlide className='rounded-md w-auto p-2'><div className='w-32 h-80'></div></SwiperSlide>
            <SwiperSlide className='rounded-md w-auto p-2'><div className='w-32 h-80'></div></SwiperSlide>
            <SwiperSlide className='rounded-md w-auto p-2'><div className='w-32 h-80'></div></SwiperSlide>
            <SwiperSlide className='rounded-md w-auto p-2'><div className='w-32 h-80'></div></SwiperSlide>
            <SwiperSlide className='rounded-md w-auto p-2'><div className='w-32 h-80'></div></SwiperSlide>
            <SwiperSlide className='rounded-md w-auto p-2'><div className='w-32 h-80'></div></SwiperSlide>
            <SwiperSlide className='rounded-md w-auto p-2'><div className='w-32 h-80'></div></SwiperSlide>
            <SwiperSlide className='rounded-md w-auto p-2'><div className='w-32 h-80'></div></SwiperSlide>
          </Swiper>
        </div>
      </div>
    </div>
  );
}

export default AmazingProduct;
